import React from "react";

const About = () => {
    return(
        <div className={'container p-4'}>
            <div className={'card mb-4'}>
                <div className={'row no-gutters'}>
                    <div className={'col-md-8'}>
                        <div className={'card-body'}>
                            <h1>NAME</h1>
                        </div>
                    </div>
                    <div className={'col-md-4'}>
                        <h1>PICTURE</h1>
                    </div>
                </div>
            </div>
        </div>
    );
}

export default About;
